import React from 'react';
import images from '../../constants/images';
import './Navbar.scss';

const Navbar = () => {
  return (
    <nav>
      <div>
        <img src={images.logo} alt="logo" width="1.5%" height="1.5%" />
      </div>
    </nav>
  );
}

export default Navbar;
